import React, { Component } from 'react';
import Navbar from 'bootstrap/dist/css/bootstrap.css';

class navBar extends Component {
    render() { 
        return (               
            <Navbar bg="light">
            <Navbar.Brand href="#home">Brand link</Navbar.Brand>
            </Navbar> );
    }
}

export default navBar;
